import logo from "./component/Logo-UKS-Usaha-Kesehatan-Sekolah-Warna.png";
import FormFloating from "./"
import "./App.css";

function App() {
  return (
    <div className="w-full h-screen flex justify-center items-center bg-gray-300">
      <div
        className={`bg-white w-1/2 text-black rounded-2xl p-8 flex flex-col`}
      >
        <div className={`flex flex-col`}>
          <div className={`flex justify-center`}>
            <img src={logo} alt="Logo" className={`size-40`} />
          </div>
          <div className={`flex flex-col`}>
            <h1 className={`text-2xl text-green-600 font-bold text-center`}>
              UKS
            </h1>
            <h1 className={`text-2xl text-green-600 font-bold text-center`}>
              SMK Negeri 2 Tasikmalaya
            </h1>
          </div>
        </div>
        <div className={`flex flex-col px-4 mt-12`}></div>
      </div>
    </div>
  );
}

export default App;
